import './App.css';
import './Header';
import Header from './Header';
import { useEffect, useState } from 'react';
import { Swiper, SwiperSlide} from 'swiper/react';
import ssswiper from './ssswiper'
function App(){
  const data = [
    {id: '1', image: 'https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.gamevicio.com%2Fnoticias%2F2023%2F09%2Fanalise-lies-of-p%2F&psig=AOvVaw2EkBLu7XjizQ5ypDAA3MKD&ust=1700480214219000&source=images&cd=vfe&opi=89978449&ved=0CBEQjRxqFwoTCNCkoayD0IIDFQAAAAAdAAAAABAJ' },
    {id: '2', image: './god.jpeg' },
    {id: '3', image: './cyber.jpg' },
  ]


  return (
    <div className="App">

      <Header></Header>
      <Swiper slidesPerView={1} pagination={{clickable: true}} navigation>
        {data.map( (item) => (
          <SwiperSlide key={item.id}>
            <img src='{item.image}'alt='Slider' className='slide-item'>

            </img>
          </SwiperSlide>
        ))}

      </Swiper>

    </div>
  );

}
export default App;
